    public static partial class JsonExtensions
    {
        public static string SortJsonElements(this JsonElement element)
        {
            List<string> list = new List<string>();

            switch (element.ValueKind)
            {
                case JsonValueKind.Array:
                    foreach (JsonElement el in element.EnumerateArray().Select(i => i))
                        list.Add("[" + el.SortJsonElements() + "]");
                    break;
                case JsonValueKind.Object:
                    foreach (var el in element.EnumerateObject().Select(i => (i.Name, i.Value)))
                        list.Add(el.Name + ": {" + el.Value.SortJsonElements() + "}" + Environment.NewLine);
                    break;
                default:
                    list.Add(element.GetRawText());
                    break;
            }

            list.Sort();

            return String.Join(", ", list.ToArray()).Replace("{[", "[{").Replace("]}", "}]");
        }
    }
